import React, { Component } from "react";
import Button from "@material-ui/core/Button/Button";
import {Link} from "react-router-dom";

class Delete extends Component {

    render() {
        return (
            <div>
            <h1>Succsessfully modified the database</h1>
                <div className="mod-buttons">
                    <div className="delete-button">
                        <Button fullWidth
                                variant="contained"
                                color="primary"
                                component={Link}
                                to="/">
                            Main page
                        </Button>
                    </div>
                    <div>
                        <Button component={Link}
                                fullWidth
                                variant="contained"
                                color="primary"
                                to="/view"
                        >View employees
                        </Button>
                        <Button component={Link}
                                fullWidth
                                variant="contained"
                                color="primary"
                                to="/search"
                        >New search
                        </Button>
                    </div>
                </div>
            </div>
        )
    }
}

export default Delete;
